import React from 'react'

const SideLink = ({ name, Icon }) => {
    return (
        <li>
            <a href="#">
                <div className="flex items-center hover:bg-primary-light hover:text-primary-base">
                    <Icon></Icon>
                    <span className="ml-4 font-bold">
                        {name}
                    </span>
                </div>
            </a>
        </li>
    )
}

export default SideLink
